// -----------------------------------------------
// 
// Macro para criação de smart enums (Ids e Tipos)
//
// -----------------------------------------------

#define DEFINE_ATRIBUTO_SMART_ENUM(SmartEnum, atributo) SmartEnum##_##atributo,
#define DEFINE_CHAR_SMART_ENUM(SmartEnum, atributo) #atributo,
#define DEFINE_CHARS_SMART_ENUM(SmartEnum, valores) static const char*  SmartEnum##Array [] = { "Nenhum", valores(DEFINE_CHAR_SMART_ENUM) "Excedente" };

#define DEFINE_GET_SMART_ENUM_FROM_CHAR(SmartEnum)\
static SmartEnum get##SmartEnum##FromChar(const char* a_char){ \
	if (strCompara( std::string("min"), std::string(a_char) )) { return SmartEnum(1); } \
	else if (strCompara( std::string("max"), std::string(a_char) )) { return SmartEnum(SmartEnum##_Excedente - 1); } \
	else if (strCompara( std::string("Nenhum"), std::string(a_char) )) { return SmartEnum##_Nenhum; } \
	for (int i = 1; i < SmartEnum##_Excedente; i++){ \
		if (strCompara( std::string(SmartEnum##Array[i]), std::string(a_char) )) \
			return SmartEnum(i); \
	}\
	return SmartEnum##_Nenhum; \
};

#define DEFINE_GET_FROM_CHAR(SmartEnum)\
static SmartEnum getFromChar(const SmartEnum a_smartEnum, const char* a_char){ \
	return get##SmartEnum##FromChar(a_char); \
};

#define DEFINE_GET_STRING_SMART_ENUM(SmartEnum)\
static std::string getString(SmartEnum a_smartEnum){ \
	if (a_smartEnum >= SmartEnum##_Excedente) \
		return std::string(SmartEnum##Array[SmartEnum##_Excedente]); \
	else if (a_smartEnum <= SmartEnum##_Nenhum) \
		return std::string(SmartEnum##Array[SmartEnum##_Nenhum]); \
	else \
		return std::string(SmartEnum##Array[a_smartEnum]); \
}

#define DEFINE_GET_FULL_STRING_SMART_ENUM(SmartEnum)\
static std::string getFullString(SmartEnum a_smartEnum){ \
	if (a_smartEnum >= SmartEnum##_Excedente) \
		return std::string(std::string(#SmartEnum) + "_" + std::string(SmartEnum##Array[SmartEnum##_Excedente])); \
	else if (a_smartEnum <= SmartEnum##_Nenhum) \
		return std::string(std::string(#SmartEnum) + "_" + std::string(SmartEnum##Array[SmartEnum##_Nenhum])); \
	else \
		return std::string(std::string(#SmartEnum) + "_" + std::string(SmartEnum##Array[a_smartEnum])); \
}

#define DEFINE_GET_STRING_TIPO_SMART_ENUM(SmartEnum)\
static std::string getStringTipo(SmartEnum a_smartEnum){ return std::string(std::string(#SmartEnum)); }

#define DEFINE_OPERADOR_SMART_ENUM_MAIS_MAIS(SmartEnum)\
inline SmartEnum& operator++(SmartEnum &a_operando, int){\
	if (a_operando <= SmartEnum##_Nenhum) \
		throw std::invalid_argument(std::string(#SmartEnum) + "::++(" + std::string(#SmartEnum) + "_" + getString(a_operando) + "):\n Operando menor ou igual a Nenhum!");\
	else if (a_operando < SmartEnum##_Excedente){\
		const int i = static_cast<int>(a_operando);\
		a_operando = static_cast<SmartEnum>(i + 1);\
	}\
	else\
		throw std::invalid_argument(std::string(#SmartEnum) + "::++(" + std::string(#SmartEnum) + "_" + getString(a_operando) + "):\n Operando maior ou igual a Excedente!");\
	return a_operando;\
};

#define DEFINE_OPERADOR_SMART_ENUM_MENOS_MENOS(SmartEnum)\
inline SmartEnum& operator--(SmartEnum &a_operando, int){\
	if (a_operando >= SmartEnum##_Excedente) \
		throw std::invalid_argument(std::string(#SmartEnum) + "::--(" + std::string(#SmartEnum) + "_" + getString(a_operando) + "):\n Operando maior ou igual a Excedente!");\
	if (a_operando > SmartEnum##_Nenhum){\
		const int i = static_cast<int>(a_operando);\
		a_operando = static_cast<SmartEnum>(i - 1);\
	}\
	else\
		throw std::invalid_argument(std::string(#SmartEnum) + "::--(" + std::string(#SmartEnum) + "_" + getString(a_operando) + "):\n Operando menor ou igual a Nenhum!");\
	return a_operando;\
};

#define DEFINE_SMART_ENUM(SmartEnum, valores)\
enum SmartEnum { SmartEnum##_Nenhum, valores(DEFINE_ATRIBUTO_SMART_ENUM) SmartEnum##_Excedente, };\
DEFINE_CHARS_SMART_ENUM(SmartEnum, valores) \
DEFINE_GET_SMART_ENUM_FROM_CHAR(SmartEnum) \
