// Como declarar os IDs:
// 1 - Criar macroX de nome XXX como ID_1XX(m).
//     Cada item de ID_1XX deve estar no formato: m(IdXXX, ElementoX).
//     Em que:
//             IdXXX corresponde ao Tipo a ser definido para o ID.
//             ElementoX corresponde ao X-ésimo elemento do ID.
// 2 - Chamar macro "DEFINE_SMART_ENUM(IdXXX, ID_1XX)" para criar um SmartEnum e seus respectivos métodos a partir do ID.
//     Um enum do Tipo IdXXX será criado, com enumeradores no formato IdXXX_Elemento1, IdXXX_Elemento2, ... IdXXX_Excedente
//     Casos particulares, como os ID_MES, ID_DIA, ID_DIA_SEMANA, ID_HOR e ID_MIN, a macro "DEFINE_SMART_ENUM(IdXXX, ID_1XX)" não é chamada e métodos específicos são criados.
// 3 - Por fim, a macroX "LISTA_ID(m)" deve ser incrementada com o item m(IdXXX).

