// Como declarar os TIPOs:
// 1 - Criar macroX de nome XXX como TIPO_1XX(m).
//     Cada item de TIPO_1XX deve estar no formato: m(TipoXXX, ElementoX).
//     Em que:
//             TipoXXX corresponde ao TIPO a ser definido.
//             ElementoX corresponde ao X-ésimo elemento do Tipo.
// 2 - Chamar macro "DEFINE_SMART_ENUM(TipoXXX, TIPO_1XX)" para criar um SmartEnum e seus respectivos métodos a partir do TIPO.
//     Um enum do Tipo IdTipoXXX será criado, com enumeradores no formato TipoXXX_Elemento1, TipoXXX_Elemento2, ... TipoXXX_Excedente
// 3 - Por fim, a macroX "LISTA_TIPO(m)" deve ser incrementada com o item m(TipoXXX).

